// Input do webhook
const data = $json["body"]["data"];

// Fun√ß√£o para formatar o email em min√∫sculo
const email = data.buyer.email ? data.buyer.email.toLowerCase() : "";

// Fun√ß√£o para separar nome e sobrenome
const fullName = data.buyer.name ? data.buyer.name.trim().split(" ") : [""];

// Separar o nome e sobrenome
const firstName = fullName[0];
const lastName = fullName.length > 1 ? fullName.slice(1).join(" ") : "";

// Fun√ß√£o para formatar o telefone
let phone = data.buyer.checkout_phone ? data.buyer.checkout_phone : "";
if (phone && !phone.startsWith("55")) {
  phone = "55" + phone;
}

// Fun√ß√£o para extrair e organizar as UTM's do campo "sck"
const sck = data.purchase.origin && data.purchase.origin.sck ? data.purchase.origin.sck : "";

function extractUtm(sck) {
  // Se a string "sck" estiver vazia, retornar valores em branco
  if (!sck) {
    return {
      utm_source: "",
      utm_campaign: "",
      utm_medium: "",
      utm_content: "",
      utm_term: ""
    };
  }

  // Dividir a string "sck" em partes separadas por "-"
  const parts = sck.split("-");

  // Remover qualquer item que esteja vazio ou n√£o relevante
  const filteredParts = parts.filter(part => part.trim() !== "");

  // Verificar se h√° UTM's suficientes na string
  if (filteredParts.length >= 5) {
    const utm_source = filteredParts[0];
    const utm_campaign = filteredParts[1];
    const utm_medium = filteredParts[2];
    const utm_content = filteredParts[3];
    const utm_term = filteredParts[4];

    return {
      utm_source: utm_source,
      utm_campaign: utm_campaign,
      utm_medium: utm_medium,
      utm_content: utm_content,
      utm_term: utm_term
    };
  } else {
    // Caso n√£o haja informa√ß√µes suficientes, retorna valores vazios
    return {
      utm_source: "",
      utm_campaign: "",
      utm_medium: "",
      utm_content: "",
      utm_term: ""
    };
  }
}

// Extrair e organizar as UTM's do campo "sck"
const utmData = extractUtm(sck);

// Outras informa√ß√µes do webhook
const productName = data.product && data.product.name ? data.product.name : "";
const productId = data.product && data.product.id ? data.product.id : "";
const transactionId = data.purchase && data.purchase.transaction ? data.purchase.transaction : "";
const purchaseStatus = data.purchase && data.purchase.status ? data.purchase.status : "";
const purchasePrice = data.purchase.price && data.purchase.price.value ? data.purchase.price.value : "";
const currency = data.purchase.price && data.purchase.price.currency_value ? data.purchase.price.currency_value : "";
const paymentType = data.purchase.payment && data.purchase.payment.type ? data.purchase.payment.type : "";
const installments = data.purchase.payment && data.purchase.payment.installments_number ? data.purchase.payment.installments_number : "";
const approvedDate = data.purchase && data.purchase.approved_date ? new Date(data.purchase.approved_date).toISOString() : "";
const orderDate = data.purchase && data.purchase.order_date ? new Date(data.purchase.order_date).toISOString() : "";

// Dados de endere√ßo
const address = data.buyer.address || {};
const zipcode = address.zipcode || "";
const country = address.country || "";
const street = address.address || "";
const city = address.city || "";
const state = address.state || "";
const neighborhood = address.neighborhood || "";
const complement = address.complement || "";
const countryIso = address.country_iso || "";

// Endere√ßo completo formatado
const fullAddress = `${street}, ${neighborhood}, ${complement ? complement + ", " : ""}${city} - ${state}, ${zipcode}, ${country}`.trim();

// Sa√≠da completa formatada
return {
  email: email,
  firstName: firstName,
  lastName: lastName,
  phone: phone,
  productName: productName,
  productId: productId,
  transactionId: transactionId,
  purchaseStatus: purchaseStatus,
  purchasePrice: purchasePrice,
  currency: currency,
  paymentType: paymentType,
  installments: installments,
  approvedDate: approvedDate,
  orderDate: orderDate,
  utm_source: utmData.utm_source,
  utm_campaign: utmData.utm_campaign,
  utm_medium: utmData.utm_medium,
  utm_content: utmData.utm_content,
  utm_term: utmData.utm_term,
  zipcode: zipcode,
  country: country,
  street: street,
  city: city,
  state: state,
  neighborhood: neighborhood,
  complement: complement,
  countryIso: countryIso,
  fullAddress: fullAddress
};

// Obter o JSON original do fluxo anterior
let originalData = $json; // Captura o JSON recebido

// Verifica se o originalData √© um array
if (Array.isArray(originalData)) {
  // Se for um array, itera e adiciona o campo "ingresso"
  originalData = originalData.map(item => {
    // Obter o c√≥digo da oferta (offer_code) do conte√∫do
    let offerCode = item.content.offer_code;

    // Adicionar o campo "ingresso" ao conte√∫do com base no c√≥digo da oferta
    if (offerCode === "z33tispk") {
      item.content.ingresso = "Ingresso Premium";
    } else if (offerCode === "kowddkf6") {
      item.content.ingresso = "Ingresso VIP";
    } else {
      item.content.ingresso = "Ingresso Regular"; // Caso padr√£o
    }

    // Retornar o item modificado
    return item;
  });
} else {
  // Se n√£o for um array, trata como um √∫nico objeto
  let offerCode = originalData.content.offer_code;

  // Adicionar o campo "ingresso" ao conte√∫do com base no c√≥digo da oferta
  if (offerCode === "z33tispk") {
    originalData.content.ingresso = "Ingresso Premium";
  } else if (offerCode === "kowddkf6") {
    originalData.content.ingresso = "Ingresso VIP";
  } else {
    originalData.content.ingresso = "Ingresso Regular"; // Caso padr√£o
  }
}

// Retornar o JSON atualizado
return Array.isArray(originalData) ? originalData : [originalData];
